// Navigation Bar and Header
import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';

const selectedNav = {
    color: '#F28F38'
}

const StyledLink = styled(NavLink)`
    &:focus,  &:hover {
    color: #F28F38;
  }
`;

class Navigation extends Component {
    render() {
        return (
            <nav className="navbar navbar-expand-md shadow-sm bg-white navbar-light">
                <StyledLink className="navbar-brand text-primary text-decoration-none" to="/">
                    <h4 className="mb-0 font-weight-normal">Sound Sustainability</h4>
                </StyledLink>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                    <div className="navbar-nav">
                        <StyledLink className="nav-btn nav-item text-decoration-none px-2" activeStyle={selectedNav} to="/screeninghome" >Hearing Screening</StyledLink>
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/about">Education</StyledLink>
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/screening">Devices</StyledLink>
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/about">About Us</StyledLink>
                        <StyledLink className="nav-btn text-decoration-none px-2" activeStyle={selectedNav} to="/about">Sign In</StyledLink>
                    </div>
                </div>
            </nav>
        );
    }
}

export default Navigation;
